MFN_US_8he208pbClass::MFN_US_8he208pbClass(TTree *tree) : fChain(0) 
{
// if parameter tree is not specified (or zero), connect the file
// used to generate this class and read the Tree.
   if (tree == 0) {
      TFile *f = (TFile*)gROOT->GetListOfFiles()->FindObject("run_0271.root");
      if (!f || !f->IsOpen()) {
         f = new TFile("run_0271.root");
      }
      f->GetObject("h9000",tree);

   }
   Init(tree);
}

MFN_US_8he208pbClass::~MFN_US_8he208pbClass()
{
   if (!fChain) return;
   delete fChain->GetCurrentFile();
}

Int_t MFN_US_8he208pbClass::GetEntry(Long64_t entry)
{
// Read contents of entry.
   if (!fChain) return 0;
   return fChain->GetEntry(entry);
}
Long64_t MFN_US_8he208pbClass::LoadTree(Long64_t entry)
{
// Set the environment to read one entry
   if (!fChain) return -5;
   Long64_t centry = fChain->LoadTree(entry);
   if (centry < 0) return centry;
   if (fChain->GetTreeNumber() != fCurrent) {
      fCurrent = fChain->GetTreeNumber();
      Notify();
   }
   return centry;
}

